import React from 'react'

function Elem1(){
  return <h1>Element 1 in O/p;</h1>
}
function Elem2(){
  return <h1>Element 2 in output</h1>
}
function RealOutput(props){
  const isOutput = props.isOutput
  if(isOutput){
    return <Elem1/>
  } 
  return <Elem2/>
}
export default function App() {
  return (
    <div>
      <RealOutput isOutput={false}/>
    </div>
  )
}
